import React ,{useState} from 'react';
import "./Registeration.css"
import { useHistory } from 'react-router';

import { BrowserRouter, Route, Link } from "react-router-dom";
function ModalsNavPage(props) {
  

/*componentDidMount(){
    fetch("https://api-nodejs-todolist.herokuapp.com/user/register",{
        method:"POST",
 
    headers:{"Content-Type": "application/json",
"Accept":"application/json"

}

    }) .then(res => res.json())
    .then(res => {
     
       console.log(res)
    })
    
     .catch(err => { console.log(err); 
     });
     
   }*/
   const [name, setName] = useState("")
const [password,setPassword ] = useState("")
const [email,setEmail ] = useState("")
const [age,setAge ] = useState("")
const history=useHistory();
async function signUp(){
       let stuff={name,password,email,age}
    console.warn(stuff)
    let result =await fetch("https://api-nodejs-todolist.herokuapp.com/user/register",{

    method:'POST',
    body:JSON.stringify(stuff),
    headers:{"Content-Type": "application/json",
"Accept":"application/json"
},
    })

    result=await result.json()
 localStorage.setItem("user",JSON.stringify(result))
 history.push('/advanced')
          }

 
        return (
            <div>
                 <div className="col-sm-6 offset-sm-3">
                 <h1 className="text-center mt-4">Sign Up</h1>
           
          
               
<input type="text" placeholder="name" onChange={(e)=>setName(e.target.value)}/>


<input type="email"  placeholder="Email"  onChange={(e)=>setEmail(e.target.value)}/>


<input type="password"  placeholder="password" onChange={(e)=>setPassword(e.target.value)}/>


<input type="number"  placeholder="age" onChange={(e)=>setAge(e.target.value)}/>
<button  className="btn btn-primary" onClick={signUp}>
Sign Up 
</button>
       
        </div> 
            </div>
        )
    
        }




export default ModalsNavPage
